<template>
  <div class="sync-data flex flex-direction align-center">
    <div class="sync-pic flex align-center">
      <div id="main-img" style="width:100%;height:100%"></div>
    </div>
    <span class="sync-tip">{{updateText}}</span>
    <div class="sync-progress flex flex-direction align-center">
      <el-progress :percentage="syncDataProgress"
                   :stroke-width="8"
                   :show-text="false"></el-progress>
      <span class="progress-text">{{syncDataProgress}}%</span>
    </div>
  </div>
</template>

<script>
import { mapGetters, mapActions } from 'vuex';
import { LOGIN_FINISHED, IS_IN_SYNCDATA_PAGE, IS_SHOW_CLOSE_SYNCDATA } from '@/store/types';
import SVGA from 'svgaplayer-didi'
import Ws, { handleRecievedQueueMsgs } from '@/utils/ws';
import { startSync } from '@/services/syncInfos'
export default {
  components: {},
  data() {
    return {
      // percentage: 50
      updateText: ''
    };
  },
  computed:{
    ...mapGetters(['syncDataProgress']),
  },
  watch: {
  },
  methods: {
    ...mapActions([LOGIN_FINISHED]),
    syncFinished(){
      console.log('ok');
      handleRecievedQueueMsgs();
      setTimeout(()=>{
        this.LOGIN_FINISHED();
        this.$store.commit(IS_IN_SYNCDATA_PAGE, false);
      }, 500);
      // this.LOGIN_FINISHED()
    },
    syncError(e){
      console.log(e)
    },
    startSync(){
      startSync(this.syncFinished, this.syncError);
    },
    setUpdateText(){
      const texts = [
        this.$t('login_register_0044'),
        this.$t('login_register_0045'),
        this.$t('login_register_0046'),
        this.$t('login_register_0047')
      ];
      let count = 0;
      this.timmerText = setInterval(()=>{
        this.updateText = texts[count++];
        if(count===4){
          clearInterval(this.timmerText);
        }
      },750)
    },
    setClose(){
      this.timmerClose = setTimeout(()=>{
        this.$store.commit(IS_SHOW_CLOSE_SYNCDATA, true);
      },30000)
    }
  },
  created() {
    this.$store.commit(IS_IN_SYNCDATA_PAGE, true);
    Ws.init(this.startSync);
    // setTimeout(this.LOGIN_FINISHED, 5000)
    //eslint-disable-next-line
    this.b64 = '';
  },
  mounted(){
    this.$nextTick(()=>{

      console.log(SVGA)
      const player = new SVGA.Player('#main-img');
      const parser = new SVGA.Parser('#main-img'); // Must Provide same selector eg:#demoCanvas IF support IE6+

      

      parser.load(`data:svga/2.0;base64,${this.b64}`, function(videoItem) {
        player.setVideoItem(videoItem);
        player.startAnimation();
      })

      this.setUpdateText();
      this.setClose();
    })
  },
  beforeDestroy() {
    this.timmerText && clearInterval(this.timmerText);
    this.timmerClose && clearTimeout(this.timmerClose);
  }
};
</script>
